		function randomGifts() { // סידור המסיחים ברנדומאליות
			var onGiftsTemp = [
				[]
			];
			var rndNumber;
			for (i = 0; i < myGame[1][onQuestion][1].length; i++) {
				onGiftsTemp[i] = myGame[1][onQuestion][1][i];
			}
		
			var runCount = onGiftsTemp.length;
			for (i = 0; i < runCount; i++) {
				rndNumber = Math.floor(Math.random() * onGiftsTemp.length) + 0;
				onGifts[i] = onGiftsTemp[rndNumber];
				onGiftsTemp.splice(rndNumber, 1);
			}
		}
		
		
